import React from "react";
import UsersCatalog from "../components/UsersCatalog";

const Users = (props) => {
  const USERS = [
    {
      id: 1,
      name: "Jeff Tebang",
      image:
        "https://scontent.fmnl4-5.fna.fbcdn.net/v/t1.0-9/44336851_2258177500863712_4359540514387656704_o.jpg?_nc_cat=106&_nc_sid=174925&_nc_eui2=AeF4QizAaUDyyHzX5X-90qYzyqlvNBS7lGbKqW80FLuUZrKiMKLmxWQNOFAaPmEZcPobgU_iE15fBDFLhIZNin5a&_nc_ohc=VTFJKH45Of0AX8k9BO1&_nc_ht=scontent.fmnl4-5.fna&oh=45a7546a75dd856ddd857e0106154abe&oe=5F5431F7",
      posts: 1,
    },
  ];

  return <UsersCatalog bits={USERS} />;
};

export default Users;
